VALUES ('3222471110539', 'Génoise fourrée orange', 'Fourrage à l\'orange 55 % : sirop de glucose-fructose - sucre - jus d\'orange à base de jus concentré 20 %* - gélifiant : pectines - acidifiant : acide citrique - arôme naturel d\'orange. Biscuit 28 % : farine de _blé_ - sucre - _oeuf_ entier 21 % - matière grasse végétale (palme) - stabilisant : sorbitol - sirop de glucose-fructose - amidon de _blé_ - amidon de tapioca - poudres à lever : carbonates d\'ammonium, carbonates de sodium - émulsifiant : mono- et diglycérides d\'acides gras - correcteur d\'acidité : citrates de sodium - sel. Nappage chocolat noir 17 % : pâte de cacao - sucre - beurre de cacao - émulsifiant : lécithine de _soja_ - arôme.', 'https://static.openfoodfacts.org/images/products/322/247/111/0539/front.7.400.jpg', '10', '5.8', '67', '57', '3.3', '3.1', '0.18', '0.0708661417322835', '', '0');

