INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222471917121', 'Petits fours pâtissiers aux 3 chocolats', 'Farine de _blé_, chocolat au _lait_ 19% (sucre - beurre de cacao - _lait_ entier en poudre - pâte de cacao - _lactose_ - émulsifiant : lécithine de _soja_), sucre, huiles et graisses végétales (palme, colza, coprah, palmiste), chocolat noir 10% (sucre, pâte de cacao, beurre de cacao, matière grasse _laitière_ anhydre, émulsifiant : lécithine de _soja_, arôme naturel de vanille), chocolat blanc 5,2% (sucre, beurre de cacao, _lait_ entier en poudre, émulsifiant : lécithine de _soja_, arôme naturel de vanille), _noisettes_ caramélisées 1,1% (sucre, _noisettes_), fourrage _lait_ [huiles végétales (palme, tournesol, colza, coton), sucre, _lait_ écrémé en poudre, _lactose_, cacao maigre en poudre, émulsifiant : lécithine de _soja_], sirop de sucre inverti, _oeufs_, caramel au sel de Guérande 0,9% [sirop de glucose, sucre, graisses végétales (palme, palmiste), _beurre_, eau, _crème_ liquide à 31% de matière grasse, sel de Guérande 1,2%, émulsifiant : lécithine de _soja_], farine de _soja_, _amandes_ effilées 0,5%, dextrose, blanc d\'_oeuf_, nougatine 0,4% (sucre, _noisettes_), chocolat en flocons (sucre, pâte de cacao, beurre de cacao, _lait_ entier en poudre, matière grasse _laitière_ anhydre, arôme naturel de vanille), cacao maigre en poudre 0,3% (dont émulsifiant : lécithine de _soja_), noix de coco 0,1%, sel, poudres à lever : carbonates de sodium, carbonates d\'ammonium, diphosphates, _lait_ écrémé en poudre, arômes naturels, _lait_ entier en poudre, huile d\'_arachide_, farine de riz, émulsifiant : lécithine de _soja_, cannelle.', 'https://static.openfoodfacts.org/images/products/322/247/191/7121/front.10.400.jpg', '27', '15.5', '63', '41', '2.2', '6', '0.36', '0.141732283464567', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222471917145', 'Petits fours pâtissiers', 'Farine de blé, sucre, huile et graisses végétales (palme, colza, coprah, palmiste), chocolat noir 12 % (sucre, pâte de cacao, beurre de cacao, matière grasse laitière anhydre, lécithine de soja, arôme naturel de vanille), chocolat au lait 12 % (sucre, beurre de cacao, lait entier en poudre, pâte de cacao, lactose, lécithine de soja), chocolat blanc 8,5 % (sucre, beurre de cacao, lait entier en poudre, lécithine de soja, arôme naturel de vanille), fourrage blanc [huiles végétales (palme, tournesol, colza, coton), sucre, lait écrémé en poudre, lactose, lécithine de soja], fourrage lait [huiles végétales (palme, tournesol, colza, coton), sucre, lait écrémé en poudre, lactose, cacao maigre en poudre, lécithine de soja], noix de coco 0,9 %, billes de céréales croustillantes 0,9 % (farine de riz, gluten de blé, malt de blé, sel, sucre, dextrose), caramel au sel de Guérande 0,9 % [sirop de glucose, sucre, graisses végétales (palme, palmiste), beurre, eau, crème liquide à 31 % de matière grasse, sel de Guérande 1,2 %, lécithine de soja], oeufs, sirop de sucre inverti, farine de soja, blanc d\'oeuf, pâte pralinée 0,5 % (sucre, noisettes, huile de noisette), dextrose, amandes caramélisées 0,3 % (amandes, sucre), lait entier en poudre, lactosérum en poudre, éclats de fèves de cacao torréfiées 0,2 %, chocolat noir du Ghana 0,1 % (pâte de cacao du Ghana, sucre, beurre de cacao, lécithine de soja, arôme naturel de vanille), sel, cacao maigre en poudre (dont lécithine de soja), arômes naturels et arômes naturels de café (dont lécithine de soja), carbonates de sodium, carbonates d\'ammonium, diphosphates, poudre de chocolat (sucre, pâte de cacao, cacao maigre en poudre, arôme naturel de vanille), amidon de blé, lait écrémé en poudre, farine de riz, arôme naturel de vanille Bourbon de Madagascar 0,04 %, huile d\'arachide, grains noirs de vanille épuisée, lécithine de soja, cannelle.', 'https://static.openfoodfacts.org/images/produ